import{_ as t,p as e,q as l,a1 as a}from"./framework-7e1a102e.js";const n={},s=a('<h1 id="qu-est-ce-qu-un-compte" tabindex="-1"><a class="header-anchor" href="#qu-est-ce-qu-un-compte" aria-hidden="true">#</a> Qu&#39;est-ce qu&#39;un compte ?</h1><p>Habituellement, sur un exchange, vous pouvez avoir plusieurs comptes avec des usages différents (Classique, trading, trading sur marge, future...), et, pour chacun d&#39;entre eux, vous avez un solde pour chaque devise.</p><p>Un solde n&#39;est pas simplement le montant que vous avez; il peut être plus compliqué se décompose donc de la façon suivante :</p><table><thead><tr><th style="text-align:left;">Champs</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;">currency</td><td style="text-align:left;">Devise</td></tr><tr><td style="text-align:left;">total</td><td style="text-align:left;">Renvoie le montant total pour la devise</td></tr><tr><td style="text-align:left;">available</td><td style="text-align:left;">Montant disponible pour le trading</td></tr><tr><td style="text-align:left;">frozen</td><td style="text-align:left;">Montant gelé</td></tr><tr><td style="text-align:left;">loaned</td><td style="text-align:left;">Montant prêté</td></tr><tr><td style="text-align:left;">borrowed</td><td style="text-align:left;">Returns emprunté</td></tr><tr><td style="text-align:left;">withdrawing</td><td style="text-align:left;">Montant verrouillé qui va être retiré</td></tr><tr><td style="text-align:left;">depositing</td><td style="text-align:left;">Montant verrouillé qui va être déposé</td></tr></tbody></table>',4),r=[s];function d(i,o){return e(),l("div",null,r)}const c=t(n,[["render",d],["__file","what-is-an-account.html.vue"]]);export{c as default};
